  #  `TypeVar`s, which the `Unpack` is 'pulling out' directly into the
  #  `Generic[]`.)
 #lass Bar(Generic[Unpack[Ts]]): ...
 #ar[int]  # Valid
 #ar[int, str]  # Also valid

